Society SMSSMR - May 19, 2012 - Karina Ballerina



Somewhere, in a dank and dingy little room, Karina is cuffed and chained, hands overhead...Ogre has his way as the activities of the city surrounding them carry on. He examines her lovely body well before he breaks out the paddle. Reddening her backside to a deep crimson and then taking the whip to it. From the chains, Karina has her ankles and wrists bound tightly before he rakes her flesh with the gloves. Then, he spreads her wide on the bench...Spread-eagle Karina is at the height of vulnerability here as Ogre steps up the intensity and gives her a true taste of pain


